import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Grid from "@material-ui/core/Grid";
import Box from "@material-ui/core/Box";
import { Typography } from "@material-ui/core";
import doctorsImg from "../../img/home/doctors.png";
import Divider from "@material-ui/core/Divider";
import Button from "@material-ui/core/Button";
const useStyles = makeStyles((theme) => ({
  container: {
    marginTop: 120,
  },
  root: {
    flexGrow: 1,
  },
  grid: {
    marginTop: 30,
  },
  divider: {
    marginTop: 20,
    height: 6,
    width: 80,
    backgroundColor: "#FF8686",
    justifyContent: "center",
  },
  ListPracticeHeading: {
    [theme.breakpoints.down("sm")]: {
      fontSize: 24,
    },
    fontSize: 28,
  },

  doctorsImg: {
    marginLeft: 20,
    marginRight: 20,
    width: "90%",
    height: "90%",
    borderRadius: 12,
  },

  ListPracticeTitle: {
    marginRight: 40,
    marginLeft: 40,

    [theme.breakpoints.down("sm")]: {
      fontSize: 20,
    },
  },

  ListPracticeBody: {
    marginRight: 60,
    lineHeight: 2,
    marginLeft: 40,
    color: "grey",
  },
  highlightText: {
    color: "#FF8686",
  },
}));

export default function ListPractice() {
  const classes = useStyles();

  return (
    <div className={classes.container}>
      <div className={classes.root}>
        <Box
          display="flex"
          flexDirection="column"
          alignItems="center"
          justifyContent="center"
        >
          <Divider className={classes.divider} />
          <br></br>
          <Typography
            color="primary"
            align="center"
            className={classes.ListPracticeHeading}
          >
            List Your Practice
          </Typography>
          <br></br>
        </Box>
        <Grid container spacing={0} className={classes.grid}>
          <Grid item sm={1} />

          <Grid item xs={12} sm={6} className={classes.leftGrid}>
            <br></br>
            <Typography
              variant="h5"
              color="primary"
              className={classes.ListPracticeTitle}
            >
              Are you a doctor?
            </Typography>
            <br></br>
            <Box display="flex" flexDirection="column" justifyContent="center">
              <Typography variant="body" className={classes.ListPracticeBody}>
                <span className={classes.highlightText}>
                  List your practice
                </span>{" "}
                on MYDoc to reach more patients and help people find their ideal
                doctor.
              </Typography>
              <Button
                variant="contained"
                color="secondary"
                size="md"
                className={classes.search}
                fullWidth
              >
                Sign up now
              </Button>
            </Box>
          </Grid>

          <Grid item xs={12} sm={4} className={classes.rightGrid}>
            <img
              src={doctorsImg}
              alt="doctorsImg"
              className={classes.doctorsImg}
            />
          </Grid>
          <Grid item sm={1} />
        </Grid>
      </div>
    </div>
  );
}
